import React from 'react';
import Blog from './Blog/Blog';
import {BrowserRouter,Route} from 'react-router-dom';
import NewPost from './NewPost/NewPost';

import './App.css';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Blog />
    </div>
    <Route path="/new-post" exact component={NewPost}/>
    </BrowserRouter>
  );
}

export default App;
